    public static int[] arrayDiff(int[] a, int[] b) {
        List<Integer> integerList = new ArrayList<>();
        for (int i = 0; i < a.length; i++) {
            boolean isNotInB = true;
            for (int j = 0; j < b.length; j++) {
                if (a[i] == b[j]) {
                    isNotInB = false;
                    break;
                }
            }

            if (isNotInB) {
                integerList.add(a[i]);
            }
        }

        return integerList.stream().mapToInt(el ->el).toArray();
    }
